import React from 'react'
import styles from './navigation.module.css'
import NavButton from './nav-button'
import * as Icons from '../components/icons'
import {MENU} from '../components/DATA/MENU'

function Navigation({flat=false,children,text,icon}) {

    
    return (
        <nav>
            {/* <NavButton  selected=""><Icons.ArrowBottom /><span>Bookmark</span></NavButton> */}
            {
                MENU.map((item)=> {
                    <NavButton key={item.key}>{item.logo} {item.text}</NavButton>
                })
            }
            
        </nav>
    )
}


export default Navigation
